    null,ntt"hash": "",ntt"description": "ZIP file containing Source files
    for non-standard code versions used to run model simulations included in the data
    release. SEAWAT version 4 source code for MT3DMS was modified to create observation
    output that is easier to post-process with python. The standard version of SEAWAT
    version 4 can also be used but observation output would have a different format
    that would not be able to be post processed with the python scripts included in
    this data release. The flopy python package (version 3.0.3) has also been included.
    flopy post-processing methods are used in the python post-processing scripts to
    read binary MODFLOW and MT3DMS output files. This version of flopy was developed
    for python 2.7 and may not run in more recent versions of python. flopy version
    3.0.3 requires NumPy 1.9 (or higher) and matplotlib 1.4 (or higher). The mapping
    and cross-section capabilities in the flopy version 3.0.3 require Pyshp 1.2 (or
    higher). The cluster_repo python package has also been included because several
    of the python pre- and post-processing scripts use the functionality in classes
    and methods. In particular, the classes and methods in shapefile.py and pestUtil.py
    are used. cluster_repo requires NumPy 1.9 or higher and pandas 0.15.2 or higher.
    The post-processing scripts also require the basemap 1.0.7 or higher.",ntt"format":
