    used to evaluate the potential effects of alterations to the hydrologic system on
    the distribution of salinity in the Biscayne aquifer in Broward County, Florida:
    U.S. Geological Survey Data Release",nt"tracking_summary": {ntt"total":
    25,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-08-03T03:15:57.000958",nt"name": "seawat-model-used-to-evaluate-the-potential-effects-of-alterations-to-the-hydrologic-system-on-61462",nt"isopen":
    false,nt"url": null,nt"notes": "A three-dimensional, variable-density solute-transport
    model (SEAWAT) was developed to examine causes of saltwater intrusion and predict
    the effects of future alterations to the hydrologic system on salinity distribution
    in eastern Broward County, Florida. The model was calibrated to conditions from
    1970 to 2012, the period for which data are most complete and reliable, and was
    used to simulate historical conditions from 1950 to 2012. The model was used to
    (1) evaluate the sensitivity of the salinity distribution in groundwater to sea-level
    rise and groundwater pumping , and (2) simulate the potential effects of increases
    in pumping, variable rates of sea-level rise, movement of a salinity control structure,
    and use of drainage recharge wells on the future distribution of salinity in the
    aquifer. This USGS data release contains all of the input and output files for the
    simulations described in the associated model documentation report (http://dx.doi.org/10.3133/sir20165022).
    This data release also includes (1) preprocessing python scripts and associated
    input data files for creating the sensitivity and scenarios runs, (2) flopy source
    code, and (3) SEAWAT (v4) source code.",nt"license_title": null,nt"extras":
